Filipino Ingeniuty at its best! Pictured above were refrigerators. Yes, they were laid down. Those were not plug in. The staff of the bbq place used it as a deep cooler. Even though, the fridge was not producing cold air, it was still insulating the items inside from the tropical heat and keeping them cold. 

I was not able to get the actual name of this restaurant. It was one of the many bbq places along the boardwalk. The staff were attentive and tried their best to explain the food even with the language barrier. The sauce they used to coat their bbqs were a little too sweet for me, but it was still good overall. Also, try their rice wrapped in leaves. Apparently, it's a local way to prolong the life of cooked rice (it's not sweet rice cake, it's typical rice paired with viands). 

