Address: Misibis Bay Resort, Cagraray Island, Bacacay, Albay


Description: 
Set on 5 hectares next to a private Albay Gulf beach, this slick hotel is a 10-minute walk from Cagraray Eco-Park and a 30-minute boat ride from the city of Legazpi.

The chic rooms feature Wi-Fi access, flat-screens, minibars, and tea and coffeemakers. Suites add separate living areas and iPod docks. There are also beachfront and poolside villas available; some with private plunge pools. Room service is offered. Kids age 11 and under stay at no extra charge sharing with parents.

There's a restaurant, a cafe and a bar. Other amenities include a gym, a spa, a game room and 3 outdoor pools (1 of which has an infinity edge overlooking the beach).
